  const display = isOpened ? 'block' : 'hidden'
  console.log(display);
  return (
    <div className="container-fluid" style={{ display }}>
      <div className="row">
        <HeaderPopupLeftMenu/>
        <HeaderPopupRightMenu/>
      </div>
    </div>
  )
}
